// src/pages/HomePage.js
import React from 'react';
// 為了在 React Router 應用中使用導航，我們必須使用 Link 替換 <a>
import { Link } from 'react-router-dom'; 

// 內部 Header 定義 (已加入 Logo 和 Link 功能)
const Header = () => (
  <header style={{ display: 'flex', justifyContent: 'space-between', padding: '1em 5%', alignItems: 'center', borderBottom: '1px solid #eee' }}>
    {/* 網站 Logo 與標題 - 使用 Link 包裹以點擊回首頁 */}
    <Link to="/" style={{ display: 'flex', alignItems: 'center', textDecoration: 'none', color: '#333' }}>
      {/* 圖片 Logo - 替換為我們建議的路徑和圖片名稱 */}
      <img 
        src="/nsdt-logo.png" // 請確保檔案 (nsdt-logo.png) 已在 public 資料夾
        alt="師聲論壇 Logo" 
        style={{ height: '40px', marginRight: '10px' }} // 調整高度以符合 Header 
      />
      <span style={{ fontSize: '1.5em', fontWeight: 'bold' }}>師聲論壇</span>
    </Link>
    
    {/* 導覽菜單 (wp:navigation) */}
    <nav>
      <ul style={{ display: 'flex', listStyle: 'none', margin: 0, padding: 0 }}>
        <li style={{ marginLeft: '20px' }}><Link to="/">首頁</Link></li>
        <li style={{ marginLeft: '20px' }}><Link to="/login">登入</Link></li>
        <li style={{ marginLeft: '20px' }}><Link to="/boards">逛逛看板</Link></li>
      </ul>
    </nav>
  </header>
); 


const HeroSection = () => {
  const coverImageUrl = "https://img.rawpixel.com/s3fs-private/rawpixel_images/website_content/a017-eberhard-19-fog-lifts-up-after-raind.jpg?w=1200&h=1200&fit=clip&crop=default&dpr=1&q=75&vib=3&con=3&usm=15&cs=srgb&bg=F4F4F3&ixlib=js-2.2.1&s=f60b088dac6c7cc04eeebf67f600e079"; 

  return (
    // 模擬 wp:cover 區塊
    <div 
        className="hero-cover" 
        style={{ 
            minHeight: '525px', 
            backgroundImage: `url(${coverImageUrl})`, 
            backgroundSize: 'cover', 
            backgroundPosition: 'center',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            textAlign: 'center',
            color: 'white', 
            position: 'relative',
            zIndex: 1,
        }}
    >
      <h2 style={{ fontSize: '3em', margin: '0 0 10px 0' }}>歡迎來到師聲NTNU Talk</h2>
      <p style={{ fontSize: '1.2em', marginBottom: '30px' }}>快進來發表你的想法</p> 

      {/* 模擬 wp:stackable/button-group */}
      <div style={{ display: 'flex', justifyContent: 'space-evenly', width: '300px' }}>
        <Link 
          to="/login" 
          style={{ padding: '10px 20px', backgroundColor: 'var(--primary-color, orange)', color: 'white', textDecoration: 'none', borderRadius: '5px' }}
        >
          立即登入
        </Link>
        <Link 
          to="/boards" 
          style={{ padding: '10px 20px', border: '2px solid white', color: 'white', textDecoration: 'none', borderRadius: '5px' }}
        >
          逛逛看板
        </Link>
      </div>
    </div>
  );
};

const HomePage = () => (
    <>
        {/* 使用內部定義的 Header */}
        <Header />
        <main>
            <HeroSection />
        </main>
        {/* 實際應用中通常會加入 Footer */}
    </>
);

export default HomePage;
